import React from 'react';
import { Authenticator, SignUp, ASignIn } from 'aws-amplify-react';
import './App.css';
import MyAmplifyTheme from './MyAmplifyTheme.js';

const App = () => {
  return (
    <Authenticator usernameAlias="email">
      <SignUp
        slot="sign-up"
        usernameAlias="email"
        formFields={[
          {
            type: "given_name",            
            placeholder: "First Name",
            required: true,
          },
          {
            type: "family_name",            
            placeholder: "Last Name",
            required: true,
          },
          {
            type: "email",  
            label: "",          
            placeholder: "Email Address",
            required: true,
          },
          {
            type: "phone_number", 
            label: "",           
            placeholder: "Phone Number (optional)",
            required: false,
          },
          {
            type: "password", 
            label: "",           
            placeholder: "Password",
            required: true,
          }          
        ]} 
      />
      <SignIn 
      headerText="Login"
      slot="sign-in" 
      usernameAlias="email"
      formFields={[        
        {
          type: "email",
          label: "",            
          placeholder: "Email Address",
          required: true,
        },        
        {
          type: "password",
          label: "",            
          placeholder: "Password",
          required: true,
        }          
      ]}  />
    </Authenticator>
  );
};

export default App;
